#  Brute force approach (not accepted by lc)
def productExceptSelf1(nums):
  answer = []
  
  for i in range(len(nums)):
    tmp = nums[:i] + nums[i+1:]
    # non mutable
    # tmp = [n for i, n in enumerate(nums) if ]]
    product = 1
    for n in tmp:
      product *= n
    answer.append(product)
    
  return answer
  
def productExceptSelf(nums):
  res = [1] * len(nums)
  
  prefix = 1
  for i in range(len(nums)):
    res[i] = prefix
    prefix *= nums[i] 
    
  suffix = 1
  for i in range(len(nums) -1, -1, -1):
    res[i] *= suffix
    suffix *= nums[i]
    
  return res
    
